import React from "react";
import { Col, Row, Tab, Tabs } from "react-bootstrap";
import { SimpleCard } from "@gull";
const AllBids = ({ biddings }) => {
  return (
    <div>
      <Col lg={12} md={12} sm={12} xs={12}>
        <SimpleCard></SimpleCard>
      </Col>
    </div>
  );
};

export default AllBids;
